import ShoppingCart from './components/ShoppingCart.tsx';

function App() {
  return (
    <div>
      <h1>Welcom to the online shopping mall!</h1>
      <div style={{ display: 'flex', justifyContent: 'center' }}>
        <Box width='80%' border='1px solid black' borderRadius='8px' p={2}>
          <ShoppingList />
        </Box>
      </div>
      <ShoppingCart 
        totalItem = {10}
        totalPrice = {16.4}
      />
    </div>
  );
}


